import * as React from 'react';
import { NavLink } from 'react-router-dom';
// import { NavLink } from 'react-router-dom';
import './navigation.scss';

const Navigation: React.FC<unknown> = () => (
  <div className="navigation-wrapper">
    <NavLink className={'link'} to="/pagination">
      HOME
    </NavLink>
    <NavLink className={'link'} to="/pagination">
      pagination
    </NavLink>
  </div>
);

export { Navigation };
